import { DataGrid } from '@mui/x-data-grid';

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'Name', headerName: 'name', width: 130 },
//   { field: 'Address', headerName: 'Address', width: 130 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'Address',
    headerName: 'Address',
    description: 'Address column',
    sortable: false,
    width: 160,
    valueGetter: (params) => params.row.Address || '', // Adjust the valueGetter function
  },

];

const rows = [
    { id: 1, Name: 'Jon', age: 35, Address: '123 Winterfell Street' },
    { id: 2, Name: 'Cersei', age: 42, Address: 'Red Keep, King\'s Landing' },
    { id: 3, Name: 'Jaime', age: 45, Address: 'Goldenhand Tower' },
    { id: 4, Name: 'Arya', age: 16, Address: 'Braavos Alley' },
    { id: 5, Name: 'Daenerys', age: null, Address: 'Dragonstone, Westeros' },
    { id: 6, Name: null, age: 150, Address: 'Unknown' },
    { id: 7, Name: 'Ferrara', age: 44, Address: 'Riverrun' },
    { id: 8, Name: 'Rossini', age: 36, Address: 'Storm\'s End' },
    { id: 9, Name: 'Harvey', age: 65, Address: 'Oldtown, The Reach' },
  ];


export default function DataTable() {
  return (
    <div style={{ height: 400, width: '80%' ,padding:'1rem'}}>
      <DataGrid
        rows={rows}
        columns={columns}
        initialState={{
          pagination: {
            paginationModel: { page: 0, pageSize: 5 },
          },
        }}
        pageSizeOptions={[5, 10]}
        checkboxSelection
      />
    </div>
  );
}
